		public static HoloCard[] Get()
		{
			return TheCards;
		}

		public static HoloCard Find(Sets set, double setNum)
		{
			return TheCards.Where(c => c.set == set && c.setNum == setNum).First();
		}

		public static HoloCard[] HasDuplicates()
		{
			int count = TheCards.Length;

			for (int i = 0; i < count; i++)
			{
				for (int j = 0; j < count; j++)
				{
					if (i != j && TheCards[i].IsEqualTo(TheCards[j]))
						return new HoloCard[] { TheCards[i], TheCards[j] };
				}
			}

			return null;
		}
	}
